window.bookSummaryJSON = "<p>After four months of training, Party Zero is ready to join up with the Stone Raiders and test out their newfound power.</p> <p>Forces have their eyes on the Stone Raiders for their own reasons. The Stone Raiders and Party Zero will be vital to the plans of higher powers and the future of Emerilia. They just have to survive long enough to make it there.</p> <p>A series of events are set into motion that will change the world, and just maybe the universe.</p>"; 
